import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


const Fname=' manjar imam';
var cuurDate = new Date().toLocaleDateString();
//var date1 = today.getFullYear()+'-'+(today.getMonth()+1)+'-'+today.getDate();

var cuurTime = new Date().toLocaleTimeString();
//var time = today.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds();

ReactDOM.render(
<>
<h1 className="h1_text">My name is {Fname}</h1>
  <p className="p_text">Current Date is = {cuurDate}</p>
  <p className="p_text">Current time is = {cuurTime}</p>
  <img className="img_1" src="https://picsum.photos/id/237/200/300" />
  </>
  ,document.getElementById('root')
  );
